            return new ArrayList<Long>(Arrays.asList());
        }
        ArrayList<Long> primes = new ArrayList<Long>();
        primes.add((long)2l);
        long i = (long)3l;
        while (i < n) {
            boolean flag = true;
            for (int j = 0; j < primes.size(); ++j) {
                long temp = (long)primes.get(j);
                if (i % temp == 0l) {
                    flag = false;
                    break;
                } else if (temp * temp > i) {
                    break;
                }
            }
            if (flag) {
                primes.add(i);
            }
            i += 2l;
        }
